import React, { useEffect } from 'react'
import 'bootstrap'

function Card(data) {
let card =''
  useEffect(()=>{
    for(let i=0; i<data[1]?.length();i++){
      console.log(data[1][i])
      card  += "<div className='col-md-9'> <div className='card text-center p-2 border-box-lg'> <div className='card-body text-dark'> <h4 className='card-title'>"+data[1][i]+"</h4> </div></div></div>";

    }
  },[data])
  return (
    <div className='searchPage__header container-fluid d-flex justify-content-center'>
        <div className='row'>
          {card}
          <div className='col-md-9'>
          <div className='card text-center border-box-lg'>
            <div className='card-body text-dark'>
            <h4 className='card-title p-2'>Card Title</h4>
            </div>
          </div>
          </div>
        </div>
    </div>    
  )
}

export default Card
